import Layout from '../Components/layout';
import Fetch from '../components/Layout';

import Display from '../Components/Display'


   

const Index = ({ data,launch })=> {
    const dataList = data;
    const LaunchTrue = launch;
          return(
        <Layout>
        <div>
       <h1>Welcome to Space X Programs </h1> 
      
       <Display passedData ={dataList} launch ={LaunchTrue} />
        </div>
        </Layout>
          )
    }
   

Index.getInitialProps = async (ctx)=>{
    const res = await fetch('https://api.spacexdata.com/v3/launches?limit=100');
    const data = await res.json();  
    return { data: data }

}


Index.getInitialProps = async (ctx)=>{
  const resL = await fetch('https://api.spacexdata.com/v3/launches?limit=100&amp;launch_success=true');
  const launch = await resL.json();  
  return { launch: launch}

}

